	"cloneTelegramApp/cloneTelegram/view/Init.view.xml":'<mvc:View\r\n  xmlns="sap.m"\r\n  xmlns:f="sap.f"\r\n  xmlns:mvc="sap.ui.core.mvc"\r\n  controllerName=\'cloneTelegramApp.cloneTelegram.controller.Init\'><Page title="Init" class="Init" showHeader="false"><FlexBox class="Init-flex"   ><VBox  alignItems="Center" class="Form-box"><Text\r\n            class="Form"\r\n            text="Welcome to our messenger"\r\n          /><Panel id="User-panel" class="Form-user"><Avatar /><Button\r\n                class="Form-button"\r\n                text="Sign In"\r\n                press=".onSignIn"\r\n              /></Panel></VBox></FlexBox></Page></mvc:View>\r\n',
